var ngControllerDirective = [function() {                                                                              // 23208
  return {                                                                                                             // 23209
    restrict: 'A',                                                                                                     // 23210
    scope: true,                                                                                                       // 23211
    controller: '@',                                                                                                   // 23212
    priority: 500                                                                                                      // 23213
  };                                                                                                                   // 23214
}];                                                                                                                    // 23215
